## Main Idea
First, it looks like we can convert the array `num` to integer and add it to `k`, but `num.length <= 1E+4` so this approach will cause integer overflow. So we will have to do the addition in array form.

Then the idea is to simulate the entire process, add each digit of `num` and `k` with a `carry` bit. We will terminate the loop when we run out of digits for both `num` and `k` and `carry == 0`.

## Code
```java
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        int n = num.length, carry = 0, i = n - 1;
        List<Integer> res = new ArrayList<>();

        while (i >= 0 || k > 0 || carry > 0) {
            int kDigit = k % 10;
            k /= 10;
            int sum = i >= 0 ? carry + kDigit + num[i] : carry + kDigit;
            res.add(sum % 10);
            carry = sum >= 10 ? 1 : 0;
            --i;
        }

        Collections.reverse(res);
        return res;
    }
}
```

## Complexity Analysis
Time: `O(2*max(N, log(K)))`
* Given a number `K`, its length will be `O(log_{2}(K))`, the time complexity depends on the length of `N` and `K`, whichever is longer.
* Notice we want to insert digits at the end of the array and then reverse it after we finish the addition (reverse takes `O(res.size())`). If we insert at the head of array, then it will take `O(n^2)` of time.

Space: `O(1)`, as we didn't use additional spaces except the return array.

#### Main Idea
The problem asks for the shortest distance from each character in a string s to a given character c. Since c may appear multiple times, we must compute the shortest distance to any occurrence of c for each index.

The key idea is to perform two passes over the string:

Left-to-right pass: Calculate distance from the nearest c to the left.

Right-to-left pass: Refine the distance by checking for any closer c on the right.

By using two passes, we can efficiently compute the minimal distance to the nearest c for each character.

#### Code

```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        int n = s.length();
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        for (int i = 0; i < n; ++i) {
            if (s.charAt(i) == c) {
                dist[i] = 0;
            } else if (i > 0 && dist[i - 1] < Integer.MAX_VALUE) {
                dist[i] = dist[i - 1] + 1;
            }
        }

        for (int i = n - 1; i >= 0; --i) {
            if (i < n - 1 && dist[i + 1] != Integer.MAX_VALUE) {
                dist[i] = Math.min(dist[i], dist[i + 1] + 1);
            }
        }

        return dist;
    }
}
```

#### Complexity
Time: `O(n)`
Space: `O(n)`

## Main Idea
A stack can be implemented with an array, but usually we only have access to stack top due to encapsulation, while we can actually access/modify any elements in the array internally.

We can implement the stack API with `array`:
* `push()`: append at the end of array (`O(1)`)
* `pop()`: remove the end of array (`O(1)`)
* `increment()`: use a for loop to increment `array[0:k]` (`O(k)`).

### Optimization. Range Update && Lazy Evaluation
Notice the time complexity of `increment()` is too high due to range update, and we can use a difference array to optimize it.

Also we don't really care about the values of elements until we `pop` them, so we can evaluate them when we pop them out of the stack.

## Code
```java
class CustomStack {
    private Deque<Integer> stack;
    private int[] arr;
    public CustomStack(int maxSize) {
        stack = new ArrayDeque<>();
        arr = new int[maxSize];
    }

    public void push(int x) {
        if (stack.size() < arr.length) {
            stack.push(x);
        } 
    }

    public int pop() {
        if (stack.isEmpty()) {
            return -1;
        }
        int index = stack.size() - 1, ret = stack.pop() + arr[index];
        if (index > 0) {
            arr[index - 1] += arr[index];
        }
        arr[index] = 0;
        return ret;
    }

    public void increment(int k, int val) {
        k = Math.min(k - 1, stack.size() - 1);
        if (k >= 0) {
            arr[k] += val;
        }
    }
}
```
## Complexity Analysis
Time: `O(1)` for all operations
Space: `O(n)` as we used 2 arrays.

### Main Idea

Storing everything in one stack will lead to so many pushes/pops, so we can use two stacks, one stack for string, one stack for number.

Iterate the input string:

* If `str[i]` is a number, parse the number, push that number to number stack, and push current string to string stack, then empty the string to start over.
* If `str[i]` is a closed bracket, then we pop the number stack to get `count`, pop the string stack to get `str`, then append the current string with `count` times to the `str`.
* Else, append the character to current string.

### Code

* Java

```java
class Solution {
    public String decodeString(String s) {
        int n = s.length();
        Deque<StringBuilder> strStack = new ArrayDeque<>();
        Deque<Integer> numStack = new ArrayDeque<>();
        StringBuilder sb = new StringBuilder();

        for (int i = 0; i < n; i++) {
            if (Character.isDigit(s.charAt(i))) {
                int j = i + 1;
                while (Character.isDigit(s.charAt(j))) {
                    j++;
                }
                int count = Integer.parseInt(s.substring(i, j));
                numStack.push(count);
                strStack.push(sb);
                sb = new StringBuilder();
                i = j - 1;
            } else if (s.charAt(i) == ']') {
                int count = numStack.pop();
                StringBuilder top = strStack.isEmpty() ? new StringBuilder() : strStack.pop();
                while (count-- > 0) {
                    top.append(sb);
                }
                sb = top;
            } else {
                if (s.charAt(i) != '[') {
                    sb.append(s.charAt(i));
                }
            }
        }

        return sb.toString();
    }
}
```

### Complexity Analysis

Time: `O(max(k) * n)`, each digit will be pushed/popped at most `max(k)` times

## Main Idea
We can use `stack1` as the input stack, and `stack2` as the output stack. 

* `push()`: Push to `stack1`, so this new element will be on the stack top of `stack1` (which is the end of our queue).
* `pop()` and `peek()`: Since we use `stack2` as our output stack, when we call `pop()` or `peek()`:
* If `stack2` is empty, we want to move all elements from `stack1` to `stack2`, and their order will be reversed, so the bottom of `stack1` will be the top of `stack2`, which is the head of our queue.
* If not, then we have access to the top of `stack2` already.

## Code

```java
class MyQueue {
    Deque<Integer> stack1;
    Deque<Integer> stack2;

    public MyQueue() {
        stack1 = new ArrayDeque<>();
        stack2 = new ArrayDeque<>();
    }

    public void push(int x) {
        stack1.push(x);
    }

    public int pop() {
        if (stack2.isEmpty()) {
            move();
        }
        return stack2.pop();
    }

    public int peek() {
        if (stack2.isEmpty()) {
            move();
        }

        return stack2.peek();
    }

    public boolean empty() {
        return stack1.isEmpty() && stack2.isEmpty();
    }

    private void move() {
        while (!stack1.isEmpty()) {
            stack2.push(stack1.pop());
        }
    }
}
```
## Complexity Analysis
Time:
* `push()`: `O(1)`
* `pop()` and `peek()`: 
	* The **worst case** of `pop()` and `peek()` will be `O(n)`, where we have to move all elements from `stack1` to `stack2`.
	* **Amortized Analysis**: Say we have `n` elements in `stack1`, and `0` elements in `stack2`, and we want to call `pop()` or `peek()` `n` times. The first call will take `n` operations to move all elements from `stack2` to `stack1`. But after the first call we will have at least `n - 1` elemetns in `stack2`, which makes the next `n - 1` calls  `O(1)`. So the amrotized time will be `O(n + 1 + 1 +...+1 / n) = O((2n-1)/n) = O(1)`.

Space: `O(1)`, the two stacks are given and we didn't use any extra spaces.

### Main Idea
For chunks `[c1, c2, c3, ..., cn]`, we have to maintain the property: `max(ci) <= min(cj)` if `i < j`. So we can create a monotonously increasing stack `stack` to **keep track of the max value for each previous chunk**. 

If `arr[i] >= stack.peek()`, we can greedily create a new chunk and `stack.push(arr[i])`. Else, we need to find the previous chunk with max value smaller or equal to `arr[i]`, say `ck`, and we need to merge all the chunks `[c_k+1, ... c_cur]` with `arr[i]`.

To merge chunks, we can just pop all the max values representing those chunks off the stack, and push back the max among them (in our case, it will be stack top cuz this stack is increasing) as the max of the new chunk. 

Finally the size of the stack will be the number of chunks.
### Code
```java
class Solution {
    public int maxChunksToSorted(int[] arr) {
        int n = arr.length;
        Deque<Integer> stack = new ArrayDeque<>();
        for (int num : arr) {
            int max = num;
            while (!stack.isEmpty() && stack.peek() > num) {
                max = Math.max(max, stack.pop());
            }
            stack.push(max);
        }
        return stack.size();
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(n)`

### Main Idea
1. Find the length of the linked list. If `length == 0`, return `head`.
2. If `k >= n`, then we can do `k = k % n` which doesn't affect the final result but reduce the number of rotations.
3. Use two pointers to traverse the linked list to find the last kth element and its previous node.
4. Modify the linked list.


### Code
```java
class Solution {
    public ListNode rotateRight(ListNode head, int k) {
        int n = getLength(head);
        if (n == 0) return head;
        k %= n;

        // Find the last kth element as new head
        ListNode fast = head, slow = head;
        for (int i = 0; i < k; ++i) {
            fast = fast.next;
        }

        while (fast.next != null) {
            fast = fast.next;
            slow = slow.next;
        }

        fast.next = head;
        ListNode newHead = slow.next;
        slow.next = null;
        return newHead;

    }

    private int getLength(ListNode head) {
        int len = 0;
        while (head != null) {
            ++len;
            head = head.next;
        }
        return len;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(1)`

### Main Idea
1. If the current list has length smaller than 2, don't need to swap.
2. Else, recursivly swap the list `head.next.next`, and the swap function should return the `next` node.
3. Swap the current 2 nodes, `newHead = head.next`, `newHead.next = head` and `head.next = next`.

### Code
```java
class Solution {
    public ListNode swapPairs(ListNode head) {
        if (head == null || head.next == null) return head;
        ListNode next = swapPairs(head.next.next);
        ListNode newHead = head.next;
        newHead.next = head;
        head.next = next;
        return newHead;
    }
}
```

### Complexity Analysis
* Time: `O(n)`
* Space: `O(n)` for the recursive call.

### Main Idea
1. Define `inOrder(int i, int j)` to be the problem of  the converting `list[i:j]` to BST.
2. Base case: if `i > j`, return `null`.
3. Calculate `mid = i + (j - i) / 2`, left subtree will be `inOrder(i, mid - 1)`, and then we create our root with the current node `cur`, then the next node to create will be `cur.next`, and we build the right sutree with `inOrder(mid + 1, j)`.

### Code
```java
class Solution {
    private ListNode cur;
    public TreeNode sortedListToBST(ListNode head) {
        if (head == null) return null;
        cur = head;
        int n = getLength(head);
        return inOrder(0, n - 1);
    }

    private TreeNode inOrder(int l, int r) {
        if (l > r) return null;
        int m = l + (r - l) / 2;
        TreeNode left = inOrder(l, m - 1);
        TreeNode root = new TreeNode(cur.val);
        cur = cur.next;
        TreeNode right = inOrder(m + 1, r);
        root.left = left;
        root.right = right;
        return root;
    }

    private int getLength(ListNode head) {
        int cnt = 0;
        while (head != null) {
            head = head.next;
            ++cnt;
        }
        return cnt;
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(logn)` for recursive calls.

