思路：
首先，计算链表的长度 n。
接着，将 k 对 n 取模，因为旋转 n 次后链表会回到原来的状态，所以取模可以避免不必要的旋转操作。
然后，找到新的链表头节点和尾节点。新的链表头节点是原链表中第 n - k 个节点，新的链表尾节点是原链表的最后一个节点。
最后，将原链表的尾节点连接到原链表的头节点，形成一个环形链表，再从新的链表头节点处断开，得到旋转后的链表。
时间复杂度：O(n)，其中 n 是链表的长度。需要遍历链表两次，第一次计算链表的长度，第二次找到新的链表头节点的前一个节点。
代码：
/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
 // 定义链表节点类
class ListNode {
    constructor(val = 0, next = null) {
        this.val = val;
        this.next = next;
    }
}
/**
 * @param {ListNode} head
 * @param {number} k
 * @return {ListNode}
 */
var rotateRight = function(head, k) {
      if (!head || !head.next) return head;

    // 计算链表的长度
    let n = 1;
    let tail = head;
    while (tail.next) {
        tail = tail.next;
        n++;
    }

    // 对 k 取模
    k %= n;

    // 如果 k 为 0，说明不需要旋转，直接返回原链表
    if (k === 0) return head;

    // 找到新的链表头节点的前一个节点
    let newTail = head;
    for (let i = 0; i < n - k - 1; i++) {
        newTail = newTail.next;
    }

    // 新的链表头节点
    let newHead = newTail.next;

    // 断开原链表，形成新的链表
    newTail.next = null;
    tail.next = head;

    return newHead; 
};

// 辅助函数：将数组转换为链表
function arrayToList(arr) {
    if (arr.length === 0) return null;
    let head = new ListNode(arr[0]);
    let current = head;
    for (let i = 1; i < arr.length; i++) {
        current.next = new ListNode(arr[i]);
        current = current.next;
    }
    return head;
}

// 辅助函数：将链表转换为数组
function listToArray(head) {
    let result = [];
    let current = head;
    while (current) {
        result.push(current.val);
        current = current.next;
    }
    return result;
}

