## 思路1

枚举每个普通字符，分别找到其左侧，右侧**最近**特殊字符的位置，求出距离，并取最小值。

1. 预处理每个特殊字符的位置，保存至数组data;
2. 枚举每个普通字符，在data中查找其左侧，右侧**最近**特殊字符的位置，求出距离，并取最小值。查找过程用可以**二分**实现，也可以用
   **单个指针记录最后一次位置**实现;
3. 返回结果。

## 思路1代码

```javascript
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function (s, c) {
        let n = s.length, data = [];
        for (let i = 0; i < n; i++) {
            if (s[i] === c) data.push(i);
        }

        // 双指针
        // left 左侧最近的c索引
        // right 右侧最近的c索引 right = left + 1
        let left = -1, right = -1, m = data.length;
        let ans = new Array(n).fill(0);
        for (let i = 0; i < n; i++) {
            let char = s[i];
            if (char === c) continue;

            let ldis = Infinity, rdis = Infinity;
            // 在data中寻找左侧最近的c索引
            // left 指针移动的条件：data[left + 1] < i，确保data[left] 是在i的左侧，距离i更近
            while (left + 1 < m && data[left + 1] < i) left++;
            if (left >= 0) ldis = i - data[left];

            right = left + 1;
            if (right < m) rdis = data[right] - i;
            ans[i] = Math.min(ldis, rdis);
        }
        return ans;
    };
```

## 思路1复杂度分析

- 时间复杂度：O(n + m)，n为字符串s的长度，m为data的长度，遍历字符串s2次,left也只是从左往右移动一次，为O(m)，所以总的时间复杂度为O(n + m)。
- 空间复杂度：O(m)，m为data的长度，不考虑返回值的话，需要一个额外的长度为m的数组来保存c的位置，所以空间复杂度为O(m)；考虑返回值，需要一个额外的长度为n的数组来保存结果，间复杂度为O(n)。

---

## 思路2

也可以枚举每个特殊字符c的位置，处理c往左、往右能覆盖的普通字符，记录每个普通字符的最小值即可。

1. 预处理每个特殊字符的位置，保存至数组data;
2. 从左往右遍历data，处理每个特殊字符c左侧的普通字符的距离，保存至数组答案ans；可以使用思路1单指针记录最后一个位置的方式，降低时间复杂度；具体可以看代码；
3. 从右往左遍历data，处理每个特殊字符c右侧的普通字符的距离，与答案ans对应位置比较，取最小值;
4. 返回答案ans。

## 思路2代码
```javascript
/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function (s, c) {
        let n = s.length, data = [], ans = new Array(n).fill(Infinity);
        for (let i = 0; i < n; i++) {
            if (s[i] === c) {
                ans[i] = 0;
                data.push(i);
            }
        }

        const m = data.length;

        // 从左往右遍历
        let left = 0;//从左往右开始，第一个普通字符的索引
        for (let j of data) {
            while (left < n && s[left] === c) left++;
            while (left < n && s[left] !== c && left < j) {
                // console.log('处理left',left,j);
                ans[left] = Math.min(ans[left], j - left);
                left++;
            }
        }

        // 从右往左遍历
        let right = n - 1;// 从右往左开始，第一个普通字符的索引
        for (let i = m - 1; i >= 0; i--) {
            let j = data[i];
            while (right >= 0 && s[right] === c) right--;
            while (right >= 0 && s[right] !== c && right > j) {
                ans[right] = Math.min(ans[right], right - j);
                right--;
            }
        }
        return ans;
    };
```
## 思路2复杂度分析

- 时间复杂度：O(n + m)，n为字符串s的长度,遍历字符串s1次,遍历data两次,left、right也只是各移动一次，所以总的时间复杂度为O(n + m)。
- 空间复杂度：O(m)，m为data的长度，不考虑返回值的话，需要一个额外的长度为m的数组来保存c的位置，所以空间复杂度为O(m)；考虑返回值，需要一个额外的长度为n的数组来保存结果，间复杂度为O(n)。

