    if(this.cnt === 0) return -1;
    let ans = this.query(this.cnt - 1);
    this.update(this.cnt - 1, -ans);
    if(this.cnt <= this.maxSize - 1) this.update(this.cnt,ans);
    this.cnt--;
    //console.log('pop ',ans,this.data);
    return ans;
