    this.update(0, val);
    let r = Math.min(k,this.maxSize,this.cnt);
    if(r <= this.maxSize - 1) this.update(r,-val);
};


CustomStack.prototype.query = function (i) {
    i = i + 1;
    let ans = 0;
    while (i) {
        ans += this.data[i];
        i -= this.lowbit(i);
    }
    return ans;
}

CustomStack.prototype.update = function (i, val) {
    i = i + 1;
    while (i <= this.maxSize) {
        this.data[i] += val;
        i += this.lowbit(i);
    }
}


