/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
    const num1 = num;
    const num2 = String(k).split('').map(v => Number(v));
    const sum = [];

    for (let i = 0; i < Math.max(num1.length, num2.length); i += 1) {
        const s = (num1[num1.length - 1 - i] ?? 0) + (num2[num2.length - 1 - i] ?? 0) + (sum[i] ?? 0);

        sum[i] = s % 10;
        sum[i + 1] = (s - (s % 10)) / 10;
    }

    if (sum[sum.length - 1] === 0) sum.pop();
    sum.reverse();

    return sum;
};
