// Time Complexity: O(n);
// Space Complexity: O(1);

var rotateRight = function (head, k) {
  if (!head || !head.next) return head;

  let length = 0;
  let cur = head;

  while (cur) {
    cur = cur.next;
    length += 1;
  }

  k = k % length;
  let left = head;
  let right = head;

  while (right.next) {
    if (k <= 0) left = left.next;
    right = right.next;
    k -= 1;
  }

  right.next = head; // Handle the case when left and right point to the same node.
  let res = left.next;
  left.next = null;

  return res;
};
```

建立一個 dummy 連結在 head 之前，便可以將 head 當作中間節點處理。每次互換節點會牽涉四個節點，pre, cur, next, next.next，其中 pre 的初始值為 dummy，因此在每個迴圈保證有值，而真正要互換的 cur, next，其兩有值為 while 迴圈繼續的必要條件，next.next 為 null 則沒關係。

```
// Time Complexity: O(n);
// Space Complexity: O(1);

/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * @param {ListNode} head
 * @return {ListNode}
 */
var swapPairs = function(head) {
    const dummy = { val: 0, next: head };

    let pre = dummy;
    let cur = pre.next;
    let next = cur?.next;

    while (cur && next) {
        pre.next = next;
        cur.next = next.next;
        next.next = cur;

        [pre, cur, next] = [cur, cur.next, cur.next?.next];
    }

    return dummy.next;
};
```

# 想法
轉換成 Height Balanced Binary Search Tree 會需要進行 Binary Search，考慮到單向鏈錶不方便直接存取 node，因此直接將鏈錶轉成數組，並直接以數組配合 Binary Search 遞迴建立樹。

```

// Time Complexity: O(n);
// Space Complexity: O(n);

/**
 * @param {ListNode} head
 * @return {TreeNode}
 */
var sortedListToBST = function(head) {
    if (head === null) return null;

    const dummy = new ListNode(0, head);
    const arr = [];

    let tail = dummy;

    while (tail) {
        const next = tail.next;
        next && arr.push(next.val);
        tail = next;
    }

    const inner = (l, r) => {
        if (l > r) return null;
        if (l === r) return new TreeNode(arr[r]);

        const m = Math.ceil((l + r) / 2);

        return new TreeNode(arr[m], inner(l, m - 1), inner(m + 1, r));
    };

    return inner(0, arr.length - 1);
};
```

