第一次思路：遍历每个字符，在每个字符上向左向右移动，直到找到字符c，继续遍历下一个字符，但想到时间复杂度一定很高，因此继续想其他方法

第二次思路：先遍历字符串，用List先记录每个字符c的索引。然后遍历字符串每个字符，计算这个字符的位置距离List中位置的最小距离，通过全部用例，时间复杂度O(N*K) N为字符串长度，K为c在字符串中出现的次数

```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        List<Integer> indexList = new ArrayList<>();
        for(int i = 0;i < s.length();i++){
            if(s.charAt(i) == c){
                indexList.add(i);
            }
        }

        int[] res = new int[s.length()];
        Arrays.fill(res,10001);
        for(int i = 0;i < res.length;i++){
            for(int index : indexList){
                res[i] = Math.min(res[i],Math.abs(i - index));
            }

        }
        return res;
    }
}

```
第三次思路：看完题解后，学习到了两次遍历求解，从左到右记录每个字符左侧最近的字符c的距离，记为left数组，从右到左记录每个字符右侧最近的字符c的距离，记为right数组。再遍历一遍整个字符串，在left数组和right数组中取最小值为最终结果。在代码实现时，省去了记录right数组再比较，而是直接比较。时间复杂度O(N)
```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        int index = -s.length();
        int[] left = new int[s.length()];
        for(int i = 0;i < s.length();i++){
            if(s.charAt(i) == c){
                index = i;
            }
            left[i] = i - index;
        }

        index = 2 * s.length();
        for(int i = s.length() - 1;i >= 0;i--){
            if(s.charAt(i) == c){
                index = i;
            }
            left[i] = Math.min(left[i],index - i);
        }
        return left;
    }
}
```

因为要设计的栈有最大长度，因此使用数组来模拟栈。否则使用栈或List来模拟。
使用数组模拟：使用一个指针变量，指向当前栈顶。入栈时，val存入栈顶处，指针++，出栈时，指针- -，返回栈顶元素。实现inc函数时，只需要对数组中0-k位置的数每个+val即可。通过全部样例
```java
class CustomStack {
    int size = 0; // 指向第一个空位置
    int[] arr;

    public CustomStack(int maxSize) {
        arr = new int[maxSize];
    }

    public void push(int x) {
        if(size < arr.length){
            arr[size] = x;
            size++;
        }
    }

    public int pop() {
        if(size > 0){
            size--;
            return arr[size];
        }else{
            return -1;
        }
    }

    public void increment(int k, int val) {
        int cut = Math.min(k,size);

        for(int i = 0;i < cut;i++){
            arr[i] += val;
        }
    }
}
```

看完题解后学会了前缀和方法：- 因为每次的increment函数都会对栈底[0,k]的数据val操作，而是否val操作了只有在pop时才会体现。所以我们可以通过一个数组incremental记录每个val，即第i位置下面的元素都要加incremental[i]。在pop第i个数的时候加上它需要加的所有val，即incremental[i]。 所以increment函数只需要维护incremental数组。但要记得记得pop后，incremental函数用过的地方要清零，并且得累加到前面一位

```java
class CustomStack {

    Stack<Integer> stack;
    int[] incremental;

    public CustomStack(int maxSize) {
        stack = new Stack<Integer>();
        incremental = new int[maxSize];
    }

    public void push(int x) {
        if(stack.size() < incremental.length){
            stack.push(x);
        }
    }

    public int pop() {
        int cut = stack.size() - 1;
        if(cut < 0) return -1;

        int res = stack.pop() + incremental[cut];

        if(cut > 0){
            incremental[cut-1] += incremental[cut]; 
        }
        incremental[cut] = 0;
        return res;

    }

    public void increment(int k, int val) {
        int cut = Math.min(k,stack.size())-1;
        if(cut >= 0){
            incremental[cut] += val;
        }
    }
}
```

看到有括号，需要对括号匹配，则优先想到栈。遍历字符串，当遇到非】字符时，全部入栈。当遇到】字符时，开始向回看，取出字符c，构成字符串s。再向回看，取出数字x，重复x次字符串s得到字符串ss，再将ss入栈，继续遍历，直到遍历结束。

最后得到的栈，就是存储了最终解码后的字符串。取出栈后记得反转字符串
```java
class Solution {
    public String decodeString(String s) {
        Stack<Character> stack = new Stack<>();
        for(int i = 0;i < s.length();i++){
            if(s.charAt(i) == ']'){
                StringBuilder sb = new StringBuilder();
                StringBuilder count = new StringBuilder();

                while(!stack.isEmpty() && stack.peek() != '['){
                    sb.append(stack.pop());
                }  
                sb.reverse();
                stack.pop();
                while(!stack.isEmpty() && stack.peek() >= '0' && stack.peek() <= '9'){
                    count.append(stack.pop());
                }
                count.reverse();
                int t = Integer.valueOf(count.toString());
                StringBuilder res = new StringBuilder();
                res.repeat(sb,t);

                for(char c : res.toString().toCharArray()){
                    stack.push(c);
                }

            }else{
                stack.push(s.charAt(i));
            }
        }
        StringBuilder re = new StringBuilder();
        while(!stack.isEmpty()){
            re.append(stack.pop());
        }
        re.reverse();
        return re.toString();
    }
}
```

- push操作：输入栈入栈
- pop操作：如果输出栈不为空，则直接输出输出栈的元素。如果输出栈为空，则把输入栈的数据全部导入到输出栈中
- peek操作：如果输出栈不为空，则直接peek输出栈的元素。如果输出栈为空，则把输入栈的数据全部导出到输入栈中
```java
class MyQueue {
    Stack<Integer> stackIn;
    Stack<Integer> stackOut;

    public MyQueue() {
        stackIn = new Stack<>();
        stackOut = new Stack<>();
    }

    public void push(int x) {
        stackIn.push(x);
    }

    public int pop() {
        refresh();
        return stackOut.pop();
    }

    public int peek() {
        refresh();
        return stackOut.peek();
    }

    public boolean empty() {
        return stackIn.isEmpty() && stackOut.isEmpty();
    }

    public void refresh(){
        if(!stackOut.isEmpty()){
            return;
        }
        while(!stackIn.isEmpty()){
            stackOut.push(stackIn.pop());
        }
    }
}
```

想象成将原始数组和排序后的数组并列排在一起，切一刀。如果这刀的左侧两个数组的数字出现的频次相同，那么右侧的频次也一定相同。这里就是一个分割点。
继续向右，有同样情况就切一刀。直到走到最后，一定会切最后一刀。记录的每一个分割点，就是分的组数。
```java
class Solution {
    public int maxChunksToSorted(int[] arr) {
        Map<Integer,Integer> map = new HashMap<>();
        int[] sortedArr = new int[arr.length];
        for(int i = 0;i < arr.length;i++){
            sortedArr[i] = arr[i];
        }
        Arrays.sort(sortedArr);

        int res = 0;
        for(int i = 0;i < arr.length;i++){
            map.put(arr[i],map.getOrDefault(arr[i],0) + 1);
            if(map.get(arr[i]) == 0){
                map.remove(arr[i]);
            }
            map.put(sortedArr[i],map.getOrDefault(sortedArr[i],0) - 1);
            if(map.get(sortedArr[i]) == 0){
                map.remove(sortedArr[i]);
            }
            if(map.isEmpty()){
                res++;
            }
        }
        return res;
    }
}
```
