先将链表连成一个环，再找到需要断开的位置断开即可
```java
class Solution {
    public ListNode rotateRight(ListNode head, int k) {
        if(head == null) return null;
        ListNode dummy = head;
        int count = 1;
        while(dummy.next != null){
            count++;
            dummy = dummy.next;
        }
        dummy.next = head;

        k = k % count;
        dummy = head;
        count = count - k;
        for(int i = 1;i < count;i++){
            dummy = dummy.next;
        }
        ListNode res = dummy.next;
        dummy.next = null;
        return res;
    }
}
```

因为遍历了链表，时间复杂度O(N)

因为要交换两个节点，所以需要记录两个节点+两个节点前的节点+两个节点后的节点，一共四个节点。分别用cur，one，two，three记录
交换完后，cur指向下一组需要交换节点的前一个节点
```java
class Solution {
    public ListNode swapPairs(ListNode head) {
        ListNode dummy = new ListNode(0);
        dummy.next = head;
        ListNode cur = dummy;
        ListNode one = null;
        ListNode two = null;
        ListNode three = null;
        while(cur.next != null && cur.next.next != null)
        {
            one = cur.next;
            two = cur.next.next;
            three = cur.next.next.next;
            cur.next = two;
            cur.next.next = one;
            cur.next.next.next = three;
            cur = cur.next.next;
        }
        return dummy.next;
    }
}
```
遍历了链表，时间复杂度O(N)

考验的是二分查找和分治构建二叉树，中间大小的数构成root根节点，左侧的数组部分分治构成左节点，右侧的数组部分分治构成右节点。这里用的是链表，只需要额外增加一些链表的操作（getMid函数）。也可以将链表转化为数组，再构造，查找起来就很快。以空间换时间
```java
class Solution {
    public TreeNode sortedListToBST(ListNode head) {
        ListNode dummy = head;
        int end = 0;
        while(head != null){
            end++;
            head = head.next;
        }

        return dfs(dummy,0,end);
    }

    public TreeNode dfs(ListNode head,int start,int end){
        if(start >= end) return null;
        int mid = start + (end - start) / 2;
        ListNode midNode = getMid(head,mid);
        TreeNode node = new TreeNode(midNode.val);
        node.left = dfs(head,start,mid);
        node.right = dfs(head,mid+1,end);

        return node;
    }

    public ListNode getMid(ListNode head,int mid){
        while(mid > 0){
            mid--;
            head = head.next;
        }
        return head;
    }
}
```
时间复杂度O(NlogN)

两个指针从head出发同时往前移动，当某一个指针指向null的时候，使其指向另一个head。直至两个指针相遇，该节点为相遇节点。直到相遇，第一个指针走了A+C+B的路程，另一个指针走了B+C+A的路程
```java
public class Solution {
    public ListNode getIntersectionNode(ListNode headA, ListNode headB) {
        ListNode A = headA;
        ListNode B = headB;
        while(A != B)
        {
            if(A == null) A = headB;
            else A = A.next;
            if(B == null) B = headA;
            else B = B.next;
        }
        return A;
    }
}
```
