## 复杂度分析

**时间复杂度**：
- push: O(1)
- pop: 均摊 O(1)
- peek: 均摊 O(1) 
- empty: O(1)

**空间复杂度**: O(n)

**均摊 O(1) 的原理**：虽然单次 pop 或 peek 操作在最坏情况下可能需要 O(n) 时间，但每个元素最多只会被转移一次，所以 n 个操作的总时间复杂度为 O(n)，均摊下来每个操作为 O(1)。

## 算法思路
- 关键观察：如果前缀[0...i]的最大值 ≤ 后缀[i+1...n-1]的最小值，则可以在位置i处分块
- 这保证了前面块的所有元素都不大于后面块的任何元素，分别排序后连接仍然有序

## 代码
```javascript
/**
 * @param {number[]} arr
 * @return {number}
 */
var maxChunksToSorted = function(arr) {
    const n = arr.length;
    if (n <= 1) return n;

    // 计算前缀最大值数组
    const prefixMax = new Array(n);
    prefixMax[0] = arr[0];
    for (let i = 1; i < n; i++) {
        prefixMax[i] = Math.max(prefixMax[i-1], arr[i]);
    }

    // 计算后缀最小值数组
    const suffixMin = new Array(n);
    suffixMin[n-1] = arr[n-1];
    for (let i = n-2; i >= 0; i--) {
        suffixMin[i] = Math.min(suffixMin[i+1], arr[i]);
    }

    let chunks = 1; // 至少有一个分块

    // 检查每个可能的分块点
    for (let i = 0; i < n-1; i++) {
        // 如果前缀最大值 <= 后缀最小值，可以在i处分块
        if (prefixMax[i] <= suffixMin[i+1]) {
            chunks++;
        }
    }

    return chunks;
};
```

## 复杂度分析
- 时间复杂度：O(n) - 需要三次遍历数组
- 空间复杂度：O(n) - 需要两个额外数组

## 核心思路 ：
-  计算链表长度并找到尾节点
-   优化k值避免重复旋转
-  找到新的尾节点（第length-k个节点）
-  重新连接：断开新尾节点与新头节点，原尾节点连接原头节点

## 代码：
```javascript
/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * @param {ListNode} head
 * @param {number} k
 * @return {ListNode}
 */
var rotateRight = function(head, k) {
    // 边界情况处理
    if (!head || !head.next || k === 0) {
        return head;
    }

    // 1. 计算链表长度并找到尾节点
    let length = 1;
    let tail = head;
    while (tail.next) {
        tail = tail.next;
        length++;
    }

    // 2. 优化k值，避免不必要的旋转
    k = k % length;
    if (k === 0) {
        return head;
    }

    // 3. 找到新的尾节点（从头开始第length-k个节点）
    let newTail = head;
    for (let i = 0; i < length - k - 1; i++) {
        newTail = newTail.next;
    }

    // 4. 新的头节点是新尾节点的下一个节点
    let newHead = newTail.next;

    // 5. 断开连接并重新连接
    newTail.next = null;  // 断开新尾节点与新头节点的连接
    tail.next = head;     // 原尾节点连接到原头节点

    return newHead;
};
```

## 复杂度分析 ：
- 时间复杂度 ：O(n) - 需要遍历链表计算长度和找到切分点
- 空间复杂度 ：O(1) - 只使用常数个额外变量

## 算法思路
- 虚拟头节点技巧: 简化边界条件处理
- 三指针法: prev, first, second 精确控制交换过程
- 原地交换: 只修改指针，不创建新节点
- 边界处理: 空链表和单节点的特殊情况

## 代码实现
```javascript
/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * @param {ListNode} head
 * @return {ListNode}
 */
var swapPairs = function(head) {
    // 边界情况：空链表或只有一个节点
    if (!head || !head.next) {
        return head;
    }

    // 创建虚拟头节点，简化操作
    let dummy = new ListNode(0);
    dummy.next = head;
    let prev = dummy;

    // 当存在至少两个节点时进行交换
    while (prev.next && prev.next.next) {
        // 定义要交换的两个节点
        let first = prev.next;
        let second = prev.next.next;

        // 执行交换操作
        // 步骤：prev -> first -> second -> ... 
        // 变为：prev -> second -> first -> ...
        prev.next = second;
        first.next = second.next;
        second.next = first;

        // 移动prev指针到已交换的第二个节点（现在是first）
        prev = first;
    }

    return dummy.next;
};
```

## 复杂度分析
- 时间复杂度：O(n) 
- 空间复杂度：O(1)

## 算法思路
- 算法的核心思想是利用有序链表的特性：
- 选择中间节点作为根节点，保证树的平衡性
- 递归地将左半部分构建为左子树，右半部分构建为右子树
- 最优解使用中序遍历的特性，避免重复遍历链表

## 代码
```javascript
/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * Definition for a binary tree node.
 * function TreeNode(val, left, right) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.left = (left===undefined ? null : left)
 *     this.right = (right===undefined ? null : right)
 * }
 */
/**
 * @param {ListNode} head
 * @return {TreeNode}
 */
var sortedListToBST = function(head) {
    // 计算链表长度
    function getLength(head) {
        let length = 0;
        while (head) {
            length++;
            head = head.next;
        }
        return length;
    }

    const length = getLength(head);
    let current = head;

    // 中序遍历构建BST
    function buildBST(start, end) {
        if (start > end) return null;

        const mid = Math.floor((start + end) / 2);

        // 先构建左子树
        const left = buildBST(start, mid - 1);

        // 创建根节点（当前链表节点）
        const root = new TreeNode(current.val);
        current = current.next;

        // 再构建右子树
        const right = buildBST(mid + 1, end);

        root.left = left;
        root.right = right;

        return root;
    }

    return buildBST(0, length - 1);
};
```

## 复杂度分析
- 时间复杂度：O(n) - 每个节点只访问一次
- 空间复杂度：O(log n) - 仅递归栈深度

