class CustomStack:
    def __init__(self, maxSize: int):
        self.maxSize = maxSize
        self.stack = []
        self.inc = [0] * maxSize

    def push(self, x: int) -> None:
        if not len(self.stack) >= self.maxSize:
            self.stack.append(x)

    def pop(self) -> int:
        if not self.stack:
            return -1
        inc_idx = len(self.stack)-1
        inc_val = self.inc[inc_idx]
        if inc_idx > 0:
            self.inc[inc_idx-1] += inc_val
        self.inc[inc_idx] = 0
        return self.stack.pop() + inc_val

    def increment(self, k: int, val: int) -> None:
        k = min(k, len(self.stack))
        if k > 0:
            self.inc[k-1] += val
