### 思路 
遍历整个字符串，总共有四种可能，分别是   数字  字母  左括号  右括号
1. 数字：定义`digit`存储读取到的数字
2. 字母：可以直接读取累加至`res`
3. 左括号：需要将前面的`res`和`digit`分别入栈，并将其赋为0和”“
4. 右括号：读取栈顶元素，循环拼接后，累加至`res`
### C++ 代码
``` C++
class Solution {
public:
    string decodeString(string s) {
        stack<int> numStack;
        stack<string> strStack;
        int digit=0;
        string res="";

        for(int i = 0; i < s.size(); i++){
            if(s.at(i) >= '0' && s.at(i) <= '9'){// 数字
                digit = digit*10+s.at(i)-'0';
            } else if(s.at(i) >= 'a' && s.at(i) <= 'z'){// 字符
                res += s.at(i);
            } else if(s.at(i) == '['){// 左括号
                numStack.push(digit);
                strStack.push(res);
                res = "";
                digit=0;
            } else {// 右括号
                int count = numStack.top();
                numStack.pop();
                string outString = strStack.top();
                strStack.pop();
                for(int i = 0; i < count; i++) outString += res;
                res = outString;
            }
        }
        return res;
    }
};
```

