2. `pop`和 `peek`需要得到入栈的第一个元素，可以使用一个辅助栈，对第一个栈进行出栈同时第二个栈进行入栈操作，这样第二个栈`top`得到的元素就是第一个栈入栈的第一个元素。

``` C++
class MyQueue {
public:
    stack<int> tmp;
    stack<int> stack;
    MyQueue() {
    }

    void push(int x) {
        tmp.push(x);
    }

    int pop() {
        while(!tmp.empty()){
            stack.push(tmp.top());
            tmp.pop();
        }
        int a = stack.top();
        stack.pop();
        while(!stack.empty()){
            tmp.push(stack.top());
            stack.pop();
        }
        return a;
    }

    int peek() {
        while(!tmp.empty()){
            stack.push(tmp.top());
            tmp.pop();
        }
        int a = stack.top();
        while(!stack.empty()){
            tmp.push(stack.top());
            stack.pop();
        }
        return a;
    }

    bool empty() {
        return tmp.empty();
    }
};

