/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     struct ListNode *next;
 * };
 */
struct ListNode* rotateRight(struct ListNode* head, int k) {
    if(head==NULL || k==0) return head;
    int len=1;
    struct ListNode * p=head;
    if(p) len=1;
    while(p->next){
        len++;
        p = p->next;
    }
    //printf("%d\n", len);
    p->next = head;
    k = k%len;
    for(int i = 0; i < len-k-1; i++){
        head = head->next;
    }
    p = head->next;
    head->next = NULL;
    return p;
}
