/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode(int x) : val(x), next(NULL) {}
 * };
 */
class Solution {
public:
    ListNode *getIntersectionNode(ListNode *headA, ListNode *headB) {
        if(headA==NULL || headB==NULL) return NULL;
        ListNode *a = headA, *b = headB;
        while(a!=b){
            if(a == NULL) a = headB;
            a = a->next;
            if(b == NULL) b = headA;
            b = b->next;
        }
        return a;
    }
};
